syntax = "proto2";

package tbclient;

import "tbclient/AvatarFrame.proto";
import "tbclient/Level.proto";
import "tbclient/Portrait.proto";
import "tbclient/Props.proto";

message MparrProps {
  optional AvatarFrame avatarframe = 1;
  optional Level level = 3;
  optional Portrait portrait = 2;
  repeated Props props = 4;
}
